import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";
// import App from "./App";

const App = () => {
  const [count, setCount] = useState([1]);
  const handlerClick = () => {
    count.push(count.length + 1);
    console.log(count);
    setCount([...count]);
  };
  return (
    <div className="root">
      <div>{count}</div>
      <div>
        <button onClick={handlerClick}>Click</button>
      </div>
    </div>
  );
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
